import React from "react";

function Header() {

    function myFunction(x) {
        x.classList.toggle("change");
      }
      

return (
<header>
    <div class="container" onclick={myFunction(this)}>
        <div class="bar1"></div>
        <div class="bar2"></div>
        <div class="bar3"></div>
    </div>
    <h1>Keeper</h1>
</header>
);
}

export default Header
